  true,\n\t\"url\": null,\n\t\"notes\": \"The Historically Black Colleges and Universities
  (HBCU) Solar Radiation Monitoring Network operated from July 1985 through December
  1996. Funded by DOE, the six-station network provided 5-minute averaged measurements
  of direct normal, global, and diffuse horizontal solar irradiance. The data were
  processed at NREL to improve the assessment of the solar radiation resources in
  the southeastern United States. Historical HBCU data available online include quality
  assessed 5-min data, monthly reports, and plots. In January 1997 the HBCU sites
  became part of the CONFRRM solar monitoring network and data from the two remaining
  active stations, Bluefield State College and Elizabeth City State University, are
  collected by the NREL Measurement & Instrumentation Data Center (MIDC).\",\n\t\"license_title\":
